def move(m, pos, kp):
    x = pos[0] 
    y = pos[1]
    if m == 'U':
        x = x-1 if (x-1,y) in kp else x
    elif m == 'D':
        x = x+1 if (x+1,y) in kp else x
    elif m == 'L':
        y = y-1 if (x,y-1) in kp else y
    elif m == 'R':
        y = y+1 if (x, y+1) in kp else y
    else:
        pass
    return (x,y)
        
